    "afsc-abl-the-gulf-of-alaska-survey-2010-to-2014",nt"isopen": false,nt"url":
    null,nt"notes": "The scientific objective of the Gulf of Alaska Survey (GOA
    Survey) is to assess Young of the Year (YOY) groundfish, salmon, plankton, and oceanographic
    conditions across the coastal, shelf, slope, and offshore waters of the GOA and
    to provide information on species distribution, ecosystem structure, and marine
    productivity in response to changes in season, region, and climate. Specific objectives
    are to 1) observe epi-pelagic fish communities by sampling with a rope trawl towed
    at the surface; 2) collect electronic oceanographic data including CTD (Conductivity-temperature-depth)
    vertical profiles of temperature, salinity, light transmission, chlorophyll a fluorescence,
    and photosynthetic available radiation (PAR); and 3) collect biological oceanographic
    samples (zooplankton and water) by oblique bongo tows and water sampling.",nt"license_title":
